% function indice_semicond_Chen and indice_AlGaAs_Chen: default spline interpolation for n, user defined for k (added by Hung-Ling)
%    40       | GaAs    | 0.2087   500  | GaAs (semi-insulating) Palik P434-440 Original data checked by Hung-Ling
