%    41.01    | GaAs    | 0.2087   1.2398  | Urbach tail 10 meV (Hung-Ling 2017/04) n unchanged
%    41.02    | GaAs    | 0.2087   1.2398  | Urbach tail 20 meV (Hung-Ling 2017/04)
%    41.03    | GaAs    | 0.2087   1.2398  | Urbach tail 30 meV (Hung-Ling 2017/04)
%    51       | Al0.1Ga0.9As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.099Ga0.901As UV-Vis from Aspnes, Kelso, Logan and Bhat, J. Appl. Phys. 60,754 (1986) and Al0.1Ga0.9As Near-IR from Adachi, J. Appl. Phys. 58, R1 (1985)
%    52       | Al0.2Ga0.8As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.198Ga0.802As UV-Vis and Al0.14Ga0.86As Near-IR
%    53       | Al0.3Ga0.7As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.315Ga0.685As UV-Vis and Al0.3Ga0.7As Near-IR
%    54       | Al0.4Ga0.6As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.419Ga0.581As UV-Vis and Al0.4Ga0.6As Near-IR
%    54.01    | Al0.4Ga0.6As | 0.2066  1.1271 | 54 with Urbach tail 10 meV
%    54.02    | Al0.4Ga0.6As | 0.2066  1.1271 | 54 with Urbach tail 20 meV
%    54.03    | Al0.4Ga0.6As | 0.2066  1.1271 | 54 with Urbach tail 30 meV
