%    56       | Al0.6Ga0.4As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.59Ga0.41As UV-Vis and Al0.6Ga0.4As Near-IR
%    57       | Al0.6Ga0.4As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.7Ga0.3As UV-Vis and Al0.7Ga0.3As Near-IR
%    58       | Al0.6Ga0.4As | 0.2066  2.4797 | AlGaAs Palik combined 2 tables: Al0.804Ga0.196As UV-Vis and Al0.8Ga0.2As Near-IR
% -------------(AlxGa1-x)0.51In0.49P lattice matched to GaAs--------------------------
%    60       | GaInP   | 0.252 1.107 | Schubert et al., J. Appl. Phys., Vol. 86, No. 4, 15 (1999)
%    60.01    | GaInP   | 0.252 1.107 | 60 Urbach tail 10 meV
%    60.02    | GaInP   | 0.252 1.107 | 60 Urbach tail 20 meV
%    60.03    | GaInP   | 0.252 1.107 | 60 Urbach tail 30 meV
%    70       | AlInP   | 0.252 1.107 | Schubert et al., J. Appl. Phys., Vol. 86, No. 4, 15 (1999)
%    70.01    | AlInP   | 0.252 1.107 | 70 Urbach tail 10 meV
%    70.02    | AlInP   | 0.252 1.107 | 70 Urbach tail 20 meV
%    70.02    | AlInP   | 0.252 1.107 | 70 Urbach tail 30 meV
%--------------------------------------------------------------------------
%    80.1     | PbS QDs | 0.258 2.066 | Quantum dots as measured by Kubo & Miyashita (2020/11/13)
%    81.1     | InAs QDs| 0.300 1.400 | InAs QDs as extracted from reflection measurement by Oteki & Giteau (2020/12). The real part is taken as that of GaAs
% method: methode d'interpolation dans le cas de tables. 
% ATTENTION Par defaut: method='spline' (voir interp1)
% il est plus prudent d'utiliser 'linear' qui conserve le signe de la partie imaginaire !
% LES VERSIONS 'OFFICIELLES' DE L'OR ET L'ARGENT SONT 2 ET 1 avec method='spline' (option par defaut) 
%
% dans le cas 4.5 (Silicium) peut etre remplacee par la temperature en Kelvin (293 par defaut)
% dans le cas 4.6 (AlxGa1-xAs) peut etre remplacee par x (0 par defaut)
%% TESTS DES DONNEES: 
%  indice = retindice(ld,parm)
%  si pas de variable en sortie, trace de la courbe sauf si ld a une seule valeur
%  si parm est un tableau, trace comparatif des paramatres
%  si en plus ld=[],trace de la courbe entre les bornes les plus grandes des parametres choisis 
%   (dans le cas de tabulation,les points tabules sont marques) 
%
% forme particuliere: n=retindice(ld,d,n2,n1) :indice effectif du mode fondamental transverse 
% d'une fibre circulaire de diam?tre d d'indice n2 dans un milieu d'indice n1
% d et ld ont la meme longueur,(ou bien l'un des 2 a un seul element)  n2 et n1 sont reels   n2/n1 peut varier entre 1.18 et 5
%   ( principe: on part d'une formule approch?e du type: (n-n1)/(n2-n1) = (1-1/(a3*x^2+a4)) * exp(-exp(a1*x+a2)) , x=n2*d./ld , 
%     suivie d'une recherche pr?cise avec retmarcuse. retindice retourne bien sur ce dernier r?sultat)
%
%% EXEMPLES de trac?s:
%  retindice([],1);
%  retindice(linspace(.2,2,1000),[2.2,2.27,2.14,2,2.4]);title('OR');
%  retindice([],[2.06,2.2,2.27,2.14,2,2.01,2.02,2.03,2.04,2.05,2.7]);title('OR');
%  retindice(linspace(.5,1,1000),[2.2,2.27,2.14,2,2.01,2.02,2.03,2.04,2.05,2.3]);title('OR');
%  retindice([],[1,1.28,1.35,1.33,1.14,1.7]);title('ARGENT');
%  retindice([],10);title('ALUMINIUM');
%  retindice([],3);
%
% See also: RETHELP_POPOV RETDRUDE

if nargin<3; method='spline'; end; if nargin<2; parm=1; end;
if nargin>3; [n,bornes,ref]=indicefibre(ld,parm,method,n1); [ldr,nr,ldi,ni]=deal([]); return; end;
%  COMPARAISONS avec superposition de courbes
if length(parm)>1; 
m=length(parm); n=cell(1,m); ldr=cell(1,m); ldi=cell(1,m); nr=cell(1,m); ni=cell(1,m);
if isempty(ld); ld=[inf,-inf]; % construction de ld
for ii=1:m; [~,bornes]=retindice([],parm(ii)); if ~isfinite(bornes(2)) ;bornes(2)=10; end;if bornes(1)==0;bornes(1)=.2;end;ld(1)=min(ld(1),bornes(1));ld(2)=max(ld(2),bornes(2));end;
ld=linspace(ld(1),ld(2),10000);
end;
reel=1; for ii=1:m; [n{ii},bornes,ref,ldr{ii},nr{ii},ldi{ii},ni{ii}]=retindice(ld,parm(ii),method);if ~isreal(n{ii});reel=0;end;end;
ma={'.k','*r','xb','+g','oc','*m','sm','dc','vg','^b','>r','<k'};maa={'-k','--r','-b','--g','c','m','-m','--c','-g','--b','r','k'};
figure;hold on;leg='lg=legend(';
for ii=1:m;jj=1+mod(ii-1,min(length(ma),length(maa)));
f=find(isfinite(n{ii})&~isnan(n{ii}));n{ii}=n{ii}(f);LD=ld(f);
f=find((ldr{ii}<max(ld))&(ldr{ii}>min(ld)));nr{ii}=nr{ii}(f);ldr{ii}=ldr{ii}(f);
f=find((ldi{ii}<max(ld))&(ldi{ii}>min(ld)));ni{ii}=ni{ii}(f);ldi{ii}=ldi{ii}(f);

if reel;
plot(LD,n{ii},maa{jj},ldr{ii},nr{ii},ma{jj});grid on; ylabel('n');    
else     
subplot(2,1,1);hold on;plot(LD,real(n{ii}),maa{jj},ldr{ii},nr{ii},ma{jj});grid on;ylabel('real(n)');
subplot(2,1,2);hold on;plot(LD,imag(n{ii}),maa{jj},ldi{ii},ni{ii},ma{jj});grid on;xlabel('longueur d''onde en microns');ylabel('imag(n)');
end;
if ~isempty(LD);leg=[leg,'''',num2str(parm(ii)),''','];end;
if ~isempty(ldr{ii});leg=[leg,''''','];end;
end;

leg=[leg(1:end-1),');'];eval(leg);set(lg,'fontsize',7);xlabel('longueur d''onde en microns');
return
end;

% Switch Parameter
switch parm;
case 4.7;  [n,bornes,ref,ldr,nr,ldi,ni]=indice_GaAs(ld,parm,method);
case {14,14.1,14.2,14.3,15,16,17,17.1,18,18.1,19,20,4.8,15.1,21,17.2,14.4,17.3,16.1,14.5,14.6,17.4}; [n,bornes,ref,ldr,nr,ldi,ni]=indice_Collin(ld,parm,method); % Removed to avoid doublons: 1.8,1.7,2.7,3.7,4.7,4.9,
case {22,18.2,18.3,22.1};  [n,bornes,ref,ldr,nr,ldi,ni]=indice_Collin2(ld,parm,method);  
case 4.5; [n,bornes,ref,ldr,nr,ldi,ni]=indice_Si(ld,method,0);   
case 4.52;[n,bornes,ref,ldr,nr,ldi,ni]=calcul_indice('Si',ld,method);  
case 4.53;[n,bornes,ref,ldr,nr,ldi,ni]=calcul_indice('Silicium',ld,method);  
case 4.51;[n,bornes,ref,ldr,nr,ldi,ni]=indice_Si(ld,method,1);   
case 4.6; [n,bornes,ref,ldr,nr,ldi,ni]=indice_algaas(0,ld,method);   
case 4.61;[n,bornes,ref,ldr,nr,ldi,ni]=indice_algaas(1,ld,method);   
case 4.62;[n,bornes,ref,ldr,nr,ldi,ni]=indice_algaas(2,ld,method);     
case 33;  [n,bornes,ref,ldr,nr,ldi,ni]=indiceSiC_drude(ld);
case {4.9,4.11,4.12,23.41,4.701,4.601,4.602,4.6021,4.603,4.604,4.605,4.606,4.607,4.621,4.702,4.703,4.704,4.886,4.887,4.888,80.1,81.1}; [n,bornes,ref,ldr,nr,ldi,ni]=indice_philippe(ld,parm,method);
case {40,41,41.01,41.02,41.03,60,60.01,60.02,60.03,70,70.01,70.02,70.03}; [n,bornes,ref,ldr,nr,ldi,ni]=indice_semicond_Chen(ld,parm,method);
case {51,52,53,54,54.01,54.02,54.03,55,56,57,58}; [n,bornes,ref,ldr,nr,ldi,ni]=indice_AlGaAs_Chen(ld,parm,method);
    
otherwise;error(['parm=',num2str(parm),'  inconnu']);
end;

% TRACE 
if (nargout==0)&&(length(ld)~=1);
if isempty(ld);if ~isfinite(bornes(2));bornes(2)=15;end;ld=linspace(max(0,bornes(1)),bornes(2),10000);[n,bornes,ref,ldr,nr,ldi,ni]=retindice(ld,parm,method);end;    
figure;
f=find(isfinite(n)&~isnan(n));n=n(f);ld=ld(f);
if isreal(n);
plot(ld,n,ldr,nr,'.k');axis([min(ld),max(ld),min(n),max(n)]);grid;title(['parm=',num2str(parm),'  ',ref],'fontsize',7);xlabel(['longueur d''onde en microns   bornes=',num2str(bornes)]);ylabel('n');    
else    
subplot(2,1,1);plot(ld,real(n),ldr,nr,'.k');axis([min(ld),max(ld),min(real(n)),max(real(n))]);grid;title(['parm=',num2str(parm),'  ',ref],'fontsize',7);ylabel('real(n)');
subplot(2,1,2);plot(ld,imag(n),ldi,ni,'.k');axis([min(ld),max(ld),min(imag(n)),max(imag(n))]);grid;xlabel(['longueur d''onde en microns   bornes=',num2str(bornes),' method=',method]);ylabel('imag(n)');
end;
end;

